var M_PI = 3.14159265;

function createSphere(radius, center, voxelSize, rotation, solid, debug) {
    var xc = center.x;
    var yc = center.y; 
    var zc = center.z;

    var red   = 255;
    var green = 0;
    var blue  = 0;

    var thisVoxelSize = voxelSize;
    var thisRadius = 0.0;
    if (!solid) {
        thisRadius = radius; // just the outer surface
    }

    // If you also iterate form the interior of the sphere to the radius, making
    // larger and larger spheres you'd end up with a solid sphere. And lots of voxels!
    var lastLayer = false;
    while (!lastLayer) {
        lastLayer = (thisRadius + (voxelSize * 2.0) >= radius);

        // We want to make sure that as we "sweep" through our angles we use a delta angle that voxelSize
        // small enough to not skip any voxels we can calculate theta from our desired arc length
        //      lenArc = ndeg/360deg * 2pi*R  --->  lenArc = theta/2pi * 2pi*R
        //      lenArc = theta*R ---> theta = lenArc/R ---> theta = g/r
        var angleDelta = (thisVoxelSize / thisRadius);

        if (debug) {
            var percentComplete = 100 * (thisRadius/radius);
            print("percentComplete="+ percentComplete+"\n");
        }
        

        // what I really want to do is iterate over slices from top to bottom, calculating
        // the radius and center for each circle for each slice at Y height
        var yStart = center.y + radius;
        var yEnd = center.y - radius;
        var radiusSquared = radius * radius;
        
        var mapHeight = map.length;
        var mapWidth = map[0].length;
        var yMapStart = 0;
        var yMapEnd = mapHeight;
        var yRatio;

        var xMapStart = 0;
        var xMapEnd = mapWidth;

        var phiStart = rotation;
        var phiEnd = rotation + M_PI * 2;
        
        for (var yAt=yStart; yAt >=yEnd; yAt -= voxelSize) {
            // at y, what is the radius of the circle at that slice?
            // we know there's a triangle with one edge from the center up the pole to height yAt,
            // and a hypotenuse of radius (from original sphere) and a right angle connecting these
            // lines to make the third edge. The length of that edge solves...
            //    a^2+b^2=c^2
            //    poleLength^2 + unknown^2 = radius^2
            //    unknown^2 = radius^2 - poleLength^2
            //    unknown^2 = radius^2 - (radius - (yAt - center.y))^2
            // unknown = sqrt(radius^2 - (distanceFromCenter^2))
            var distanceFromCenter;
            if (yAt > center.y) {
                distanceFromCenter = yAt - center.y;
            } else {
                distanceFromCenter = center.y - yAt;
            }
            var sliceRadius = Math.sqrt(radiusSquared - (distanceFromCenter * distanceFromCenter));
            
            yRatio = (yAt - yStart)/(yEnd - yStart);

            for (var phi=phiStart; phi <= phiEnd; phi += angleDelta) {

                var y = yAt;
                var x = xc + sliceRadius * Math.sin(phi);
                var z = zc + sliceRadius * Math.cos(phi);
                
                var phiRatio = (phi-phiStart) / (phiEnd - phiStart);
                
                mapY = Math.floor(yMapStart + yRatio * (yMapEnd-yMapStart));
                mapX = Math.floor(xMapStart + phiRatio * (xMapEnd-xMapStart));

                if (mapY < 0) {
                    mapY = 0;
                } else if (mapY >= mapHeight) {
                    mapY = mapHeight-1;
                }

                if (mapX < 0) {
                    mapX = 0;
                } else if (mapX >= mapWidth) {
                    mapX = mapWidth - 1;
                }

                var mapCode = map[mapY][mapX];
                if (mapCode == " ") {
                    red = 0;
                    green = 0;
                    blue = 255;
                } else {
                    switch (mapCode) {
                        case "@":
                            red = 0;
                            green = 128;
                            blue = 0;
                        break;
                        default:
                            red = 10;
                            green = 120;
                            blue = 0;
                        break;
                    }
                }

                Voxels.queueDestructiveVoxelAdd(x,y,z, voxelSize, red, green, blue);
                //print("Voxels.packetsToSendCount()="+ Voxels.packetsToSendCount() + "\n");
            }
        }
        
        thisRadius += thisVoxelSize;
    }
}

var rotation = 0;

var currentIteration = 0;
var NUM_ITERATIONS_BEFORE_SEND = 15;
 
function waitTillDrawn() {
    if (currentIteration++ % NUM_ITERATIONS_BEFORE_SEND === 0) {

        var radius = 12.5 / TREE_SCALE;
        //var center = { x: (radius*2), y: (radius*2), z: (radius*2) };
        var center = {  
            x: 1315/TREE_SCALE, 
            y: 465/TREE_SCALE,
            z: 1885/TREE_SCALE };
        
        var voxelSize = 0.5 / TREE_SCALE;
        var solid = false;
        var debug = false;
        var rotationDelta = M_PI/30;
        rotation += rotationDelta;
        if (rotation >= M_PI * 2) {
            rotation = 0;
        }
        createSphere(radius, center, voxelSize, rotation, solid, debug);

        print("Voxel Stats: " + Voxels.getLifetimeInSeconds() + " seconds," + 
            " Queued packets:" + Voxels.getLifetimePacketsQueued() + "," +
            " PPS:" + Voxels.getLifetimePPSQueued() + "," +
            " BPS:" + Voxels.getLifetimeBPSQueued() + "," +
            " Sent packets:" + Voxels.getLifetimePacketsSent() + "," +
            " PPS:" + Voxels.getLifetimePPS() + "," +
            " BPS:" + Voxels.getLifetimeBPS() + 
            "\n");

        /**    
        if (Voxels.packetsToSendCount() === 0) {
            print("DONE!!\n");

            //print("Voxels.packetsToSendCount()="+ Voxels.packetsToSendCount() + "\n");


            Agent.stop();
        }
        **/
    }
}

 
